    // }

    return <div key={el.id}>
      <span>{el.title}</span>
      <p>{title}</p>
    </div>
  })

  return (
    <div>
      <div className='photo'>
        <img src={img} alt="product" />
        <span>{Publishing}</span>
        <i className="fa-solid fa-ellipsis-vertical"></i>
      </div>
      <div className='info-product'>
        {result}
      </div>
    </div>
  )
}

export default ProductBox
